import{_ as e,o as t,c as r,O as i}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 43-17 Limitation on suit to enforce lien.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/43-17.md","filePath":"vacode/43-17.md"}'),a={name:"vacode/43-17.md"},o=i('<h1 id="§-43-17-limitation-on-suit-to-enforce-lien" tabindex="-1">§ 43-17 Limitation on suit to enforce lien. <a class="header-anchor" href="#§-43-17-limitation-on-suit-to-enforce-lien" aria-label="Permalink to &quot;§ 43-17 Limitation on suit to enforce lien.&quot;">​</a></h1><p>No suit to enforce any lien perfected under §§ <a href="http://law.lis.virginia.gov/vacode/43-4/" target="_blank" rel="noreferrer">43-4</a>, <a href="http://law.lis.virginia.gov/vacode/43-5/" target="_blank" rel="noreferrer">43-5</a> and <a href="http://law.lis.virginia.gov/vacode/43-7/" target="_blank" rel="noreferrer">43-7</a> to <a href="http://law.lis.virginia.gov/vacode/43-10/" target="_blank" rel="noreferrer">43-10</a> shall be brought after six months from the time when the memorandum of lien was recorded or after sixty days from the time the building, structure or railroad was completed or the work thereon otherwise terminated, whichever time shall last occur; provided, however, that the filing of a petition to enforce any such lien in any suit wherein such petition may be properly filed shall be regarded as the institution of a suit under this section; and, provided further, that nothing herein shall extend the time within which such lien may be perfected.</p><p>Code 1919, § 6433; 1926, p. 43; 1956, c. 399.</p>',3),n=[o];function l(s,h,c,d,f,_){return t(),r("div",null,n)}const u=e(a,[["render",l]]);export{p as __pageData,u as default};
